export class ComplicationAVC
{

    IdAvc: number;
    PatientId: number;
    Avc: boolean;
    Nombre: number;
    Date: string;
    Convulsions?: boolean;
    TroublesDeLaConscience?: boolean;
    DeficitMoteur?: boolean;
    Fievre?: boolean;
    Autre?: boolean;
    PreciserAutre?: string;
    TdmCerebrale?: boolean;
    ResultatTdm?: string;
    AngioIrm?: boolean;
    ResultatIrm?: string;
    LieuHospitalisation?: string;
    HyperhydratationPerso?: boolean;
    HyperhydratationIv?: boolean;
    AntalgiquesPalliesI?: boolean;
    AntalgiquePallierIi?: boolean;
    AntalgiquePallierIii?: boolean;
    TransfusionSimple?: boolean;
    EchangeTransfusionnel?: boolean;
    AutreTraitement?: boolean;
    PreciserAutreTraitement?: string;
    Sequelles?: boolean;
    PreciserSequelles?: string;
    constructor()
    {
        this.IdAvc = 0;
        this.PatientId = 0;
        this.Avc = false;
        this.Nombre = 0;
        this.Date = '';
        this.Convulsions = false;
        this.TroublesDeLaConscience = false;
        this.DeficitMoteur = false;
        this.Fievre = false;
        this.Autre = false;
        this.PreciserAutre = '';
        this.TdmCerebrale = false;
        this.ResultatTdm = '';
        this.AngioIrm = false;
        this.ResultatIrm = '';
        this.LieuHospitalisation = '';
        this.HyperhydratationPerso = false;
        this.HyperhydratationIv = false;
        this.AntalgiquesPalliesI = false;
        this.AntalgiquePallierIi = false;
        this.AntalgiquePallierIii = false;
        this.TransfusionSimple = false;
        this.EchangeTransfusionnel = false;
        this.AutreTraitement = false;
        this.PreciserAutreTraitement = '';
        this.Sequelles = false;
        this.PreciserSequelles = '';
    }

}
